script { fun main() { // this is a comment line }
} You can use double-slash " // " to write line comments. Rules are simple - everything after " // " is considered a comment to the end of line. You can use line comments to leave short notes for other developers or to comment out some code to remove it from execution chain. script { // let's add a note to everything! fun main() { let a = 10; // let b = 10 this line is commented and won't be executed let b = 5; // here comment is placed after code a + b // result is 15, not 10! }
}

