Module is set of functions and types packed together which developer publishes under his address. In prevous chapters we only used scripts, though script can only operate with published modules or standard library which itself is a set of modules published under 0x0 address. Module is published under its sender's address. Standard library is published under 0x0 address. When publishing a module, none of its functions are executed. To use module - use scripts. Module starts with module keyword, which is followed by module name and curly braces - inside them module contents is placed. module Math { // module contents public fun sum(a: u64, b: u64): u64 { a + b }
} Module is the only way to publish code accessible for others; new types and resources can too only be defined within module context. By default your module will be compiled and published from your address. However if you need to use some modules locally (e.g. for testing or developing) or want to specify your address inside module file, use address <ADDR> {} syntax: address 0x1 {
module Math { // module contents public fun sum(a: u64, b: u64): u64 { a + b }
}
} Like shown in example: best practice is to keep module line without indentation

