To resolve naming conflicts (when 2 or more modules have same names) and to shorten you code you can change name of the imported module using keyword as. Syntax: use <Address>::<ModuleName> as <Alias>; In script: script { use 0x0::Transaction as Tx; // Tx now means Transaction fun check_assert() { Tx::assert(true, 11); }
} The same in module: module Math { use 0x0::Vector as Vec; fun length(&v: vector<u8>): u64 { Vec::length(&v) }
}

