This should be clear by now, but let's repeat. Function can take arguments (values passed into function). As many as needed. Every argument has 2 properties: name - its name within a function body, and type - just like any other variable in Move. Function arguments - just like any other variables defined within a scope - live only within function body. When function block ends, no variables remain. module Math { public fun sum(a: u64, b: u64): u64 { a + b } fun zero(): u8 { 0 }
] What's new in our Math: function sum(a,b) which sums two u64 values and returns result - u64 sum (type can't change). Let's state few syntax rules: Arguments must have types and must be separated by comma Function return value is placed after parentheses and must follow a colon Now how would we use this function in script? Through import! script { use 0x1::Math; // used 0x1 here; could be your address use 0x0::Debug; // this one will be covered later! fun main(first_num: u64, second_num: u64) { // variables names don't have to match the function's ones let sum = Math::sum(first_num, second_num); Debug::print<u64>(&sum); }
}

44.body:
In previous examples we've experimented with functions with no return value or with single. But what if I told you that you can return multiple values of any type? Curious? Let's proceed! To specify multiple return values you need to use parentheses: module Math { // ... public fun max(a: u8, b: u8): (u8, bool) { if (a > b) { (a, false) } else if (a < b) { (b, false) } else { (a, true) } }
} This function takes two arguments: a and b and returns two values : first is the max value from two passed and second is a bool - whether numbers entered are equal. Take closer look at the syntax: instead of specifying singe return argument we've added parenteses and have listed return argument types. Now let's see how we can use result of this function in another function in script. script { use 0x0::Debug; use 0x1::Math; fun main(a: u8, b: u8) { let (max, is_equal) = Math::max(99, 100); Transaction::assert(is_equal, 1) Debug::print<u8>(&max); }
} In this example we've destructed a tuple: created two new variables with values and types of return values of function max . Order is preserved and variable max here gets type u8 and now stores max value, whereas is_equal is a bool . Two is not the limit - number of returned arguments is up to you, though you'll soon learn about structs and see alternative way to return complex data.

45.body:
When defining a module you may want to make some functions accessible by other developers and some to remain hidden. This is when function visibility modifiers come to play. By default every function defined in module is private - it cannot be accessed in other modules or scripts. If you've been attentive, you may have noticed that some of the functions that we've defined in our Math module have keyword public before their definition: module Math { public fun sum(a: u64, b: u64): u64 { a + b } fun zero(): u8 { 0 }
} In this example function sum() is accessible from outside when module is imported, however function zero() is not - it is private by default. Keyword public changes function's default private visibility and makes it public - i.e. accessible from outside. So basically if you didn't make sum() function public , this wouldn't be possible: script { use 0x1::Math; fun main() { Math::sum(10, 100); // won't compile! }
}

