61.body:
Resource in Move is defined as a resource struct and just like struct it can only be defined within module context, and unlike struct, resource will outlive your script. To understand that let's look at this example: // here's our module to manage records on chain
module RecordsCollection { use 0x0::Transaction as Tx; // the very basic information about our record struct Record { name: vector<u8>, author: vector<u8>, year: u64 } // imaginary collection of records struct Collection { records: vector<Record> } public fun create_record(name: vector<u8>, author: vector<u8>, year: u64): Record { Record { name, author, year } }
} What happens if we use module RecordsCollection in a script and call a method add_new()? New struct will be created in a script context. What happens when script scope ends? All defined variables and structs will be dumped: use {{sender}}::RecordsCollection as Collection; fun main(name: vector<u8>, author: vector<u8>, year: u64) { let r = Collection::create_record(name, author, year); // record is created but it saved somewhere? // where does it go when script ends? nowhere!
} Going further: even if we created Collection struct and pushed newly created Record in it, whole collection would still have been gone by the end of scope. That's when the resource struct comes into play. It can be saved, accessed, updated and destroyed. It outlives the script and affects blockchain state.

63.body:
First order of business - turning struct into resource struct. We will do it only for collection (you'll see why): resource struct Collection { records: vector<Record>
} Even better (or say more correct) way to name main resource in module is "T": // since whole module is named RecordsCollection
// everyone will understand that T equals Collection
resource struct T { records: vector<Record>
} As you can see, nothing but an addition of one keyword. What actually happens? Collection remains a type. Just like struct you can initialize it (in resource-specific way), you can push records into it and (!) what's really important: this resource struct will be saved on chain linked to your address making it possible to read and change it again in future transactions. Even more! If module is properly organized, you can even let other people see your collection, and (only if you want to do so!) you can let them add records into your collection. TLDR; It's time to code! Move has 5 built-in functions to work with collections, we'll go through all of them in order.

